import React, { Fragment, useEffect, useRef, useState } from 'react'
import Logout from '../AccountUser/LogoutUser/logout';
import PersonIcon from '@mui/icons-material/Person';
import '../Navbar/navbar.css'
import LogoutIcon from '@mui/icons-material/Logout';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Login from '../AccountUser/LoginUser/Login';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { formControlLabelClasses, IconButton, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import CartItem from '../CartItem/cartItem';





const navigationBar = () => {

 
    return (

      <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
    
      

      <Typography fontSize='1.5em' fontFamily='' paddingRight='470px'>
        
          Alex e-shop

      </Typography>

      <IconButton component={Link} to="/login"> 
          <PersonIcon  color='primary' fontSize='large'/>
      </IconButton>

      
      <IconButton component={Link} to='/cart'>
        <ShoppingCartIcon  color='primary' fontSize='large'/>
      </IconButton>
    

     
    
     <Logout />
     
     </Container>
    </Navbar>
    )
}




export default navigationBar;
